beta( 3 )= 9.9481e-01 ;
beta( 4 )= 3.1610e-01 ;
beta( 5 )= 2.2765e-01 ;
beta( 6 )= 4.1503e+02 ;
beta( 7 )= -2.6441e-01 ;
